  false,\n\t\"url\": null,\n\t\"notes\": \"Mink were trapped off the seabird nesting
  islands south east of Vinalhaven, Maine (outer Penobscot Bay) during the late 1990's,
  and the local Black Guillemot population has been monitored. This effort resulted
  in the reestablishment of successful guillemot colonies on the islands in 1998 and
  1999. The following describes guillemot population monitoring efforts and results
  during the 2000 season.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
